import React, { useState } from 'react'



const date = new Date();
const res = date.toLocaleTimeString();




const Profile = () => {
  const [times, setTimes]= useState(0)

  setInterval((()=>setTimes(times+1)),1000)




  return (
    <div >
      <div >{times}</div>
    </div>
  )
}

export default Profile
